import './card.css';
const Card = () => {
    return (
        <div className="card">
              <div className="card-top">
                <div className="card-labels">
                    {/* <Chip text="Frontend" color="green"></Chip>
                    <Chip close text="Frontend" color="blue"></Chip> */}
                </div>
                <MoreHorizontal/>

              </div>
              <div className="card-title">
                wmdaffknlk mdfka
              </div>
              <div className="card-footer">
                <p><Clock/>29 Sept</p>
                <p><CheckSquare/>
                1/4
                </p>
              </div>
        </div>
     );
}
 
export default Card;
